import { useEffect } from "react"
import api from "../services/api"

export default function Home(){
    useEffect(() =>{
        async function loadData(){
            const res = await api.get('/')
        }
        console.log(res)
        loadData();
    }, [])
    return (
    <div>
        Home
    </div>
    )
}
